import RegisterForm from "./forms/Register"
import {BrowserRouter as Router, Route} from 'react-router-dom'
import React, {Component} from 'react'

class PageRouter extends Component{  
    constructor(props){
        super(props)
        this.state = {
            isLoaded : false,
            pageView : false
        }
        this.loadedComponent = null
    }
    loadedComponentFromUrl = ({match}) => {
        switch(match.params){
            case "register":            
                this.loadedComponent = <RegisterForm/>
                break;
        }
        this.setState({isLoaded : true, pageView : true});
    }
    render(){
        return(
            <div>
                <Route render={()=> this.loadedComponentFromUrl ? this.loadedComponent : ''}/>
            </div>
        )
    }
}

export default PageRouter;
